import {authRoles} from "owp/auth";
import store from "owp/store";
import {logoutUser} from "owp/auth/store/actions";

export const LogoutConfig = {
    auth  : authRoles.user,
    routes: [
        {
            path     : '/logout',
            component: () => {
                store.dispatch(logoutUser());
                return 'Logging out..'
            }
        }
    ]
};
